selector_to_html = {"a[href=\"#archivos-y-directorios-extras\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Archivos y directorios extras<a class=\"headerlink\" href=\"#archivos-y-directorios-extras\" title=\"Link to this heading\">#</a></h3><p>Dentro de la configuraci\u00f3n (<code class=\"docutils literal notranslate\"><span class=\"pre\">conf.py</span></code>), a\u00f1adimos el directorio <code class=\"docutils literal notranslate\"><span class=\"pre\">files</span></code>. Este\ndirectorio nos permite a\u00f1adir archivos directamente al directorio ra\u00edz del\nsitio generado. Esto es importante porque algunas validaciones requieren archivos\nen esta posici\u00f3n, como lo son:</p>", "a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#dependencias\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Dependencias<a class=\"headerlink\" href=\"#dependencias\" title=\"Link to this heading\">#</a></h3><p>Usaremos Sphinx para la generaci\u00f3n del contenido est\u00e1tico y Ablog nos permitir\u00e1\nincluir etiquetas para fechas, que son la diferencia esencial para distinguir una\np\u00e1gina de una publicaci\u00f3n (y con ello, opciones de filtros para \u00edndices).</p><p>Respecto a la apariencia, podemos encontrar distintos temas, pero yo me he\ninclinado por PyData (que adem\u00e1s usan varios blogs que sigo, as\u00ed que he visto su\nresultado y tengo como indagar como usan algunas cosas). Adicional, conviene\nagregar Sphinx Design para a\u00f1adir componentes adicionales como cuadr\u00edculas, pesta\u00f1as,\ntarjetas y otros.</p>", "a[href=\"#blog-conf\"]": "<div class=\"literal-block-wrapper docutils container\" id=\"blog-conf\">\n<div class=\"code-block-caption\"><span class=\"caption-text\">Definici\u00f3n de ruta de \u00edndice del blog y patr\u00f3n de ruta de publicaciones.</span><a class=\"headerlink\" href=\"#blog-conf\" title=\"Link to this code\">#</a></div>\n<div class=\"highlight-python notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">blog_path</span> <span class=\"o\">=</span> <span class=\"s1\">'blog'</span>\n<span class=\"n\">blog_post_pattern</span> <span class=\"o\">=</span> <span class=\"s1\">'*/blog/*/*'</span>\n</pre></div>\n</div>\n</div>", "a[href=\"#exclude-files\"]": "<div class=\"literal-block-wrapper docutils container\" id=\"exclude-files\">\n<div class=\"code-block-caption\"><span class=\"caption-text\">Definici\u00f3n de archivos y directorios a excluir de la compilaci\u00f3n.</span><a class=\"headerlink\" href=\"#exclude-files\" title=\"Link to this code\">#</a></div>\n<div class=\"highlight-python notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">exclude_patterns</span> <span class=\"o\">=</span> <span class=\"p\">[</span>\n    <span class=\"s2\">\"_build\"</span><span class=\"p\">,</span>\n    <span class=\"s2\">\"***/.ipynb_checkpoints/*\"</span><span class=\"p\">,</span>\n    <span class=\"s1\">'Pipfile'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'LICENSE'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'README.md'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'requirements*.txt'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'.vscode'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'.venv'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'docs'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'.doctrees'</span><span class=\"p\">,</span>\n    <span class=\"s1\">'.gitignore'</span><span class=\"p\">,</span>\n<span class=\"p\">]</span>\n</pre></div>\n</div>\n</div>", "a[href=\"#y-ahora-que\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u00bfY ahora qu\u00e9?<a class=\"headerlink\" href=\"#y-ahora-que\" title=\"Link to this heading\">#</a></h2><p>Pues te cuento que ahora sigue empezar a escribir en el blog. Pero tambi\u00e9n nos\nqueda algo de exploraci\u00f3n todav\u00eda.</p><p>De mi parte, algunos detalles que quiero pr\u00f3ximamente</p>", "a[href=\"#generacion\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generaci\u00f3n<a class=\"headerlink\" href=\"#generacion\" title=\"Link to this heading\">#</a></h3><p>Estamos listos, as\u00ed que generemos el sitio.</p>", "a[href=\"#creando-el-blog\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Creando el blog<a class=\"headerlink\" href=\"#creando-el-blog\" title=\"Link to this heading\">#</a></h2><p>Bueno, hora de poner manos a la obra. Para ello vamos a seguir el paso a paso.</p>", "a[href=\"#por-que-sphinx\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u00bfPor qu\u00e9 Sphinx?<a class=\"headerlink\" href=\"#por-que-sphinx\" title=\"Link to this heading\">#</a></h2><p>Sphinx es un generador est\u00e1tico de documentaci\u00f3n, casi el est\u00e1ndar para los\nproyectos desarrollados en Python, y para el cual se dispone de una buena cantidad\nde extensiones que nutren a este generador, entre las cuales, encontramos incluso\nuna para convertir nuestro proyecto en un blog, y es Ablog.</p><p>Dado que mi lenguaje de programaci\u00f3n principal es Python, es claro que por ello\nquiero una opci\u00f3n basada en Python. Pero antes yo usaba Nikola, que tambi\u00e9n est\u00e1\ndesarrollado en Python, pero Sphinx da el beneficio de una comunidad mayor y m\u00e1s\nactiva (como usuarios y desarrolladores). Adicional a esto, el desarrollo de Sphinx\ny sus extensiones va m\u00e1s a la par de cambios en el ecosistema, y m\u00e1s alineado con\nlas directivas de docutils. En los cambios del ecosistema, me parece interesante como\nel soporte de Jupyter Notebooks y Myst resulta muy natural, por lo cual entradas sobre\nc\u00f3digo pueden tener un beneficio, y Myst expande las opciones de Markdown (y no es\nsoportado adecuadamente en Nikola, ni en otros generadores que revis\u00e9).</p>", "a[href=\"#crear-un-blog-con-sphinx\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Crear un blog con Sphinx<a class=\"headerlink\" href=\"#crear-un-blog-con-sphinx\" title=\"Link to this heading\">#</a></h1><p>Por fin he dado el paso de retomar el blog, y con ello un proceso de migraci\u00f3n\nque deseaba, generar el blog con Sphinx. Sobre este proceso les estar\u00e9 contando\nen varias entradas, ya que la migraci\u00f3n no la he concluido, y esta es la primera\nentrada al respecto, con lo m\u00e1s b\u00e1sico para iniciar y no fracasar en el intento.</p>", "a[href=\"#configuracion\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n<a class=\"headerlink\" href=\"#configuracion\" title=\"Link to this heading\">#</a></h3><p>Puedes usar <code class=\"docutils literal notranslate\"><span class=\"pre\">ablog</span> <span class=\"pre\">start</span></code> y responder las preguntas b\u00e1sicas de inicializaci\u00f3n</p>", "a[href=\"#primera-publicacion\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Primera publicaci\u00f3n<a class=\"headerlink\" href=\"#primera-publicacion\" title=\"Link to this heading\">#</a></h3><p>Ablog nos ayud\u00f3 generando en la inicializaci\u00f3n, unos archivos de demostraci\u00f3n.\nPuedes editarlos y disponerlos en la ubicaci\u00f3n que consideres.</p><p>El caso de <code class=\"docutils literal notranslate\"><span class=\"pre\">index.rst</span></code>, es necesario disponerlo en la ubicaci\u00f3n generada para la\ncompilaci\u00f3n del proyecto.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
